{'_content': "La Défense is Europe's largest purpose-built business district. 180.000 people work here.

This square is called <i>Parvis de La Défense</i> and is 300x120m. On the right is a huge mall and on the left is a smaller one. The subway is underneath the square.

In the back you can see the Arc de Triomphe. Behind that is the Champs-Élysées, behind that is the Place De La Concorde and behind that is the Louvre, 7km from here."}

