BREATHING FLOWER, 2019Tissu, soufflerie, éclairage LED, acier, structure bois
Figure de proue de l’art coréen, l’artiste et designer Choi Jeong Hwa mêle les disciplines, alliant art visuel, design graphique, design industriel et architecture. Son travail s’inspire de l’imagerie populaire et puise sa matière première dans l’industrie de masse. L’artiste collecte des matériaux bon marché, des objets de consommation du quotidien, qu’il détourne et assemble pour créer des sculptures joyeuses et colorées. Breathing Flower oxygène l’Esplanade de La Défense !Les immenses fleurs de lotus gonflables sont parmi les œuvres les plus emblématiques du travail de l’artiste. Symbole de pureté, le lotus est une fleur sacrée dans l’iconographie Bouddhiste. Sa représentation gonflable par l’artiste Choi Jeong Hwa appelle à plusieurs interprétations. Avec cette sculpture plus grande que nature, en matière synthétique et aux couleurs irréelles, l’artiste désanctifie l’icône religieuse pour en faire un objet ornemental enchanteur. Une allusion à l’éloignement du spirituel en Corée, un pays soumis à l’urbanisation rapide en plein essor économique. Les pétales de cette immense corolle de 7 mètres de diamètre se meuvent lentement au rythme des impulsions d’air, créant la sensation étrange d’une respiration. L’artiste insuffle la vie comme pour en conjurer la beauté éphémère.'}

{'_content': '<a href="https://www.ladefense.fr/sites/default/files/pdf/les_extatiques_dp.pdf" rel="noreferrer nofollow">www.ladefense.fr/sites/default/files/pdf/les_extatiques_d...</a>

ÉLOGE DE L’ENVOL, (IMAGE ARRÊTÉE), 2019Aluminium peint, acier peint, résine
Artiste pluridisciplinaire, notamment connu pour ses photographies où il se met en scène dans des situations improbables, Philippe Ramette expérimente et propose des points de vue décalés sur le monde. Tout dans l’œuvre de l’artiste fait écho au quotidien. En jouant avec les codes de la perception, en défiant les règles de l’équilibre et de la pesanteur du monde, l’artiste questionne, avec humour et poésie, la présence humaine dans l’espace.«   Si la sculpture, Éloge de l’envol (Image arrêtée), a été imaginée spécifiquement pour l’exposition Les Extatiques (et sa thématique de l’année : l’air), j’ai souhaité qu’elle s’intègre particulièrement sur l’Esplanade de La Défense.La sculpture, qui représente une balançoire agrandie, semble être figée dans le mouvement le plus ascendant qu’elle puisse permettre. Comme si on avait opéré sur elle un « arrêt sur image ». L’assise de la balançoire est maintenue en l’air, la personne supposée y être installée l’ayant désertée.Je crois que cette sculpture offre une version poétique de l’envol. Elle représente une sorte de trait d’union entre le sol (l’esplanade), et le ciel (l’air).On peut également dans le contexte particulier du quartier de Paris La Défense (lieu par excellence d’activité intense) y voir un appel au dépassement de soi, une incitation à l’élévation.La balançoire d’une manière très entendue nous ramène au monde de l’enfance, à ses rêves, son rapport particulier à la réalité, sa poésie, mais aussi à son impatience à vouloir grandir, à ce désir de vouloir « voler de ses propres ailes »'}

{'_content': '<a href="https://www.ladefense.fr/sites/default/files/pdf/les_extatiques_dp.pdf" rel="noreferrer nofollow">www.ladefense.fr/sites/default/files/pdf/les_extatiques_d...</a>

OCTOPIED-BUILDING, 2019 - Gonflable en nylon, soufflerie
Designs in Air a été fondé par le duo d’artistes britanniques, Luke Egan et Pete Hamilton, alias Filthy Luker et Pedro Estrellas. Pionniers dans la fabrication de volumes gonflables, ils investissent l’espace public, depuis les années 90, avec de spectaculaires installations. Connues sous le nom d’Arts Attacks, leurs sculptures délirantes sont autant d’attaques visuelles, drôles et provocatrices, placées au cœur des villes. Plus récemment, les artistes ont lancé le projet Musii (Multi Sensory Interactive Inflatable), en collaboration avec le musicien Jnr. Hacksaw. Musii est un instrument de musique gonflable conçu pour l’éveil thérapeutique d’enfants porteurs de handicaps.Pour l’exposition à Paris La Défense, un poulpe géant envahit un immeuble en chantier ! Ce monstre marin, aux tentacules de 10 m de long, qui prend vie grâce à l’air qu’on lui insuffle, ne manque pas de sensibiliser le grand public à l’importance de la biodiversité et à l’urgence de la préserver.'}

