{'_content': 'L’aire des espaces d’air : au cœur du parcours artistique, une exposition dans l’exposition est proposée par le commissaire, à travers la présentation de 30 photographies/reproductions  d’œuvres historiques et contemporaines qui retracent la fascination des artistes pour le thème de l’air au cours de l’histoire de l’art.

Dans le prolongement (agrandir) : &quot;Envol&quot; et &quot;Qui sème le vent&quot;, deux autres des oeuvres exposées dans le cadre de la manifestation &quot;L&quot;art en plein air&quot;, les Extatiques, Paris La Défense.
'}

