{'_content': '&quot;The Tours Aillaud (also known as Tours Nuages) is a group of residential buildings located in Nanterre, in the inner suburbs of Paris, France.

&quot;Built in 1977 at the outskirts of La Défense business district, the Tours Aillaud are named after their main architect, Emile Aillaud. The housing project represents 18 towers including 1,607 apartments all together. The tallest of those are the Tours 1 and 2 with 39 floors and a height of 105 metres. The Tours 3 to 10 have 20 floors and the Tours 11 to 18 have 13 floors.

&quot;Despite the differences in height, the towers share the same shape, consisting of the superposition of several cylinders. Their cladding is made of frescos representing clouds in the sky (in French nuages), which is the origin of their nickname.&quot;

Source: <a href="https://en.wikipedia.org/wiki/Tours_Aillaud" rel="noreferrer nofollow">Wikipedia</a>'}

