{'_content': 'Carlos CRUZ-DIEZ - Environnement de Transchromie Circulaire, 1965-2017

L’Environnement de Transchromies de Carlos Cruz-Diez est une structure circulaire, participative et chatoyante, au cœur de laquelle le spectateur est invité à redécouvrir son environnement naturel ou urbain. Conçue pour être construite   in situ et hors les murs l'oeuvre tient compte de la réalité extérieure et la transforme par la soustraction de la couleur grâce aux lamelles transparentes qui se mêlent. Cruz-Diez y déploie une conception singulière de l'abstraction, initiée dès 1969 lorsqu'il élabore son premier « Projet pour un environnement de couleur soustractive ».

<a href="https://parisladefense.com/fr/les-extatiques-2020/paris-la-defense/carlos-cruz-diez" rel="noreferrer nofollow">parisladefense.com/fr/les-extatiques-2020/paris-la-defens...</a>'}

{'_content': "Canard ou lapin ? C'est  selon ce que l'oeil perçoit en premier


RIEN A VOIR : Au fil de l’histoire de l’art les artistes ont toujours été fascinés par les jeux de perspectives, les phénomènes optiques, les illusions, l’ambiguïté des images doubles... curieux d’explorer les limites de l’art et de brouiller les pistes de lectures du spectateur. Au cœur du parcours artistique des Extatiques 2020  une exposition est proposée par le commissaire Fabrice Bousteau, à travers la présentation de quinze photographies/reproductions d’œuvres historiques et contemporaines qui invitent à entrer dans le monde magique des apparences trompeuses.

LES EXTATIQUES 2020, Paris La Défense"}

{'_content': 'Héctor ZAMORA - ZIG ZAG, 2020

Le pavillon ZIG ZAG propose une nouvelle expérience architecturale. Construit avec des briques ajourées en terre cuite, qui donnent de la transparence aux murs, il permet à la brise estivale de s’introduire apportant son souffle. La perméabilité est clé ; le motif visuel des briques multiplie leur effet lorsque les murs se chevauchent, les silhouettes des corps se déplacent à travers ces murs, et les ombres retracent et reconstruisent le motif du sol. C’est une expérience inédite qui rappelle l’architecture moderne des tropiques, et qui, au milieu de l’esplanade de La Défense, incarne une fraîcheur ludique nous invitant à nous détendre et à nous perdre dans ses murs.

