{'_content': "Après le premier confinement de 2020, de nouvelles pistes cyclables avaient été créées en Ile-de-France. Depuis, elles sont en voie d'être pérennisées !

La 3ème étape du déconfinement aura lieu demain, avec la réouverture des piscines, gymnases et restaurants et un couvre-feu plus tardif à 23 heures.

Avec la progression de la vaccination, l'optimisme doit se propager cet été, tout en restant vigilant."}

{'_content': 'Daniel BUREN,  La Défense

&quot; Pour cette œuvre, l’artiste a choisi de suivre le contour du cratère, véritable lieu de passage des usagers du site de La Défense, pour dessiner juste au-dessus de lui un cercle de 30,56 m. Seize mâts de 10 m de haut en acier galvanisé sont implantés à intervalles réguliers, au sommet desquels sont fixées des girouettes en inox et des manches à air multicolores, en tissu polyester composé de bandes verticales alternativement blanches et colorées de 8,7 cm. Ces gigantesques manches à air de plus de quatre mètres de long, tournent continuellement en suivant la direction du vent, élément prédominant sur l’esplanade. À la tombée du jour, elles se transforment en œuvres lumineuses grâce aux Leds placées à l’intérieur des cônes.&quot;

<a href="https://parisladefense.com/fr/decouvrir/oeuvres-art/la-ronde-des-manches-a-air" rel="noreferrer nofollow">parisladefense.com/fr/decouvrir/oeuvres-art/la-ronde-des-...</a>'}

{'_content': "La Défense

Le &quot;Japan Bridge&quot;, conçu par l'architecte japonais Kisho Kurokawa, a une portée unique de 100 mètres. Pour dessiner cette passerelle piétonne, Kurokawa s'est inspiré du design des ponts traditionnels japonais. Elle a été mise en service en 1993.

The Japan Bridge, designed by the Japanese architect Kisho Kurokawa, has a unique range of 100 meters. To design this pedestrian bridge, Kurokawa was inspired by the design of traditional Japanese bridges. It was put into service in 1993."}
